INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (9, "サツキ", "おう\n好きなもん持ってきな", 2, 0.0, "2025/06/16 15:00:00", 10034, 2, 1, -470.0, 135902, 0.0, "2025/09/23 14:59:59", 2002);
