INSERT INTO `v1_e8362512ba0384b979a6fcc86177729c983df79da29e43ac3b7d17beaefc5d5c` VALUES (10, "ヴォルガーノ", "よぅ！　今日の俺さまは\n門番じゃなく、店番だぜ\nメモピ～スフィア～てな！", 1, 5.549, "2025/09/16 15:00:00", 10040, 2, 1, -470.0, 137701, 0.0, "2025/12/23 14:59:59", 2002);
